  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bowdoin NWR outlines
  Refuge accomplishments from January through April of 1943. The report begins by
  summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, raptors, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments and plantings. Resource management
  is outlined; topics include grazing and fur harvesting. The public relations section
  of the report describes Refuge visitors, Refuge participation, and fishing. N-R
  forms and photographs are attached. A summary of activities on Lake Thibadeau, Creedman
  Coulee, Black Coulee, and Hewitt Lake Refuges is also included.\",\n\t\"owner_org\":
